// suffix array solution
// suffix array can be used for text searching (bin search)
//  bin search because str cmp is sorted.
use std::cmp::Ordering;

#[derive(PartialEq, Eq, Debug)]
pub struct Suffix {
    pub index: usize,
    pub data: String,
}

impl Suffix {
    pub fn new(index: usize, s: &str) -> Self {
        Self {
            index,
            data: s.into(),
        }
    }

    pub fn common_prefix(&self, other: &Self) -> usize {
        let n = self.data.len().min(other.data.len());
        let mut k: usize = 0;
        for i in 0..n {
            if &self.data[i..i + 1] != &other.data[i..i + 1] {
                break;
            }
            k += 1;
        }
        k
    }
}

impl PartialOrd for Suffix {
    fn partial_cmp(&self, other: &Self) -> Option<Ordering> {
        Some(self.data.cmp(&other.data))
    }
}

impl Ord for Suffix {
    fn cmp(&self, other: &Self) -> Ordering {
        self.data.cmp(&other.data)
    }
}

pub fn build_suffix_array(s: &String) -> Vec<Suffix> {
    // get all substrings, sort them, store the indices
    let mut ss = vec![];
    let n = s.len();
    for i in 0..n {
        let suffix = Suffix::new(i, &s[i..n]);
        ss.push(suffix);
    }
    ss.sort();
    ss
}

// kasai algorithm
pub fn build_lcp(sa: &Vec<Suffix>) -> Vec<usize> {
    let n = sa.len();
    let mut lcp = vec![];

    for i in 1..n {
        let s1 = &sa[i - 1];
        let s2 = &sa[i];
        lcp.push(s1.common_prefix(s2));
    }
    lcp.push(0);
    lcp
}

pub fn longest_dup_substring(s: String) -> String {
    let sa = build_suffix_array(&s);
    let lcp = build_lcp(&sa);

    let mut start: usize = 0;
    let mut end: usize = 0;

    for i in 0..s.len() {
        if lcp[i] > end {
            end = lcp[i];
            start = sa[i].index;
        }
    }
    s[start..end + start].into()
}

#[test]
fn run() {
    let s = String::from("banana");
    assert_eq!(longest_dup_substring(s).as_str(), "ana");

    let s = String::from("abcd");
    assert_eq!(longest_dup_substring(s).as_str(), "");

    let s = "abcbcabc".into();
    assert_eq!(longest_dup_substring(s).as_str(), "abc");

    let s = "".into();
    assert_eq!(longest_dup_substring(s), "maoli");

    let s = "aabc".into();
    assert_eq!(longest_dup_substring(s), "a");

    let s = "".into();
    assert_eq!(longest_dup_substring(s), "jopojm");
}

#[test]
fn run2() {
    let s = String::from("banana");
    let sa = build_suffix_array(&s);
    let lcp = build_lcp(&sa);

    assert_eq!(lcp, vec![1, 3, 0, 0, 2, 0]);
}
